export async function getToken() {
    var data =
    {
        "email": "kheragacy04@a.com",
        "password": ""
    }

    const response = await fetch('https://localhost:8080/api/users/token', {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json'
        },
        body: JSON.stringify(data)
    })
    if (!response.ok) {
        throw new Error("Authorization wasn\'t successfully")
    }

    return response
}
